import React, { Component } from 'react';
import './App.css';


class App extends Component {

   constructor() {
    super()
    this.state = {
      people: ""  

    }
  }

  componentDidMount() {
    fetch('http https://swapi.co/api/people/')
      .then(response=> response.json())
      .then(people => {this.setState({people:people})});

  }
  render() {
    const people = this.state;
    return (
      <div className="App">


        <h1>{people}</h1>

      </div>
    );
  }
}


export default App;
